const { AssertionError } = require('node:assert');
const assert = require('node:assert');

const decimalToRoman = require('./decimal-to-roman');

const testCases = {
  1234: 'MCCXXXIV',
  101011:
    'MMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMXI',
  401: 'CDI',
  401401:
    '',
  51143829:
    '',
  201: 'CCI',
  123: 'CXXIII',
  abc: false,
  0: '',
};

for (const test in testCases) {
  const roman = decimalToRoman(test);
  try {
    assert.equal(roman, testCases[test]);
    console.log(`✅ Test case passed for number ${test}`);
  } catch (err) {
    if (err instanceof AssertionError)
      console.log(
        `❌ test case failed for number ${test}. Expected: ${err.expected} but got: ${err.actual}`
      );
  }
}
